const Forecast = ({data}) => {
    return (
    <>
        <lable className = "title"> Daily</lable>
        <Accordion allowZeroExpanded>
            {data.list.splice(0,7).map((item, idx) =>(
                <AccordionItem>
                <AccordionItemHeading></AccordionItemHeading>
                <AccordionItemPanel></AccordionItemPanel>
                </AccordionItem>
            ))}
        </Accordion>
    </>)
}

export default Forecast;
